(46, 'IWOKA', 'EDUARDO OROZCO', 800, 6, 2, 3, 'El emprendimiento Parque Natural Iwoka es un camping recreativo que funciona en la Localidad de Mojón de Fierro, situado en la rivera del Riacho Pilagá  a 25km de la Ciudad de Formosa, cuenta con instalaciones adecuadas para Turismo Rural, quincho mediano, parrillas, sillas, mesas, dos sanitarios diferenciados para mujeres y hombres , cocina de campo, cancha deportiva, habitaciones con muebles, aire acondicionado y sector de acampe', '2023-12-15 08:07:41'),
